mergeI18nTranslations(JSON.parse("{\"ar\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"يسمح للمستخدم بإرسال رسائل إلى أفراد المساق كل على حدة.\",\"conversations_69a8dc26\":\"المحادثات\",\"people_b4ebb13c\":\"الأشخاص\",\"people_course_ddd9a66\":\"الأشخاص (المساق)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"لتحرير تحديد المستخدم، يجب أيضًا تمكين المستخدمون - السماح بإجراءات إدارية في المساقات والمستخدمون - عرض القائمة. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"لتحرير قسم مستخدم، يجب أيضًا تمكين المستخدمون - السماح بإجراءات إدارية في المساقات والمستخدمون - عرض القائمة.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"في حالة التعطيل، لا يزال بإمكان الطلاب إرسال رسائل فردية إلى معلمي المساق ومعلمي المساق المساعدين والطلاب الذين يتبعون نفس المجموعات على مستوى الحسابات.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"في حالة التعطيل، لا يزال بإمكان الطلاب إرسال رسائل فردية إلى معلمي المساق ومعلمي المساق المساعدين والطلاب الذين يتبعون نفس المجموعات على مستوى الحسابات.\"},\"ca\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Permet a l'usuari enviar missatges a membres individuals del curs.\",\"conversations_69a8dc26\":\"Converses\",\"people_b4ebb13c\":\"Persones\",\"people_course_ddd9a66\":\"Persones (Curs)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Per editar una secció d'un usuari, Usuaris - permet accions administratives als cursos i Usuaris - visualitza la llista també han d'estar habilitats.\",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Per editar una secció d'un usuari, Usuaris - permet accions administratives als cursos i Usuaris - visualitza la llista també han d'estar habilitats.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Si s'inhabilita, els estudiants encara poden enviar missatges individuals als professors i auxiliars de professors del curs i als estudiants que formen part dels mateixos grups a nivell del compte.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Si s'inhabilita, els estudiants encara poden enviar missatges individuals als professors i auxiliars de professors del curs i als estudiants que formen part dels mateixos grups a nivell del compte.\"},\"cy\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Yn gadael i ddefnyddiwr anfon negeseuon at aelodau unigol o’r cwrs.\",\"conversations_69a8dc26\":\"Sgyrsiau\",\"people_b4ebb13c\":\"Pobl\",\"people_course_ddd9a66\":\"Pobl (Cwrs)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"I olygu adran defnyddiwr, rhaid i’r adran Defnyddwyr - caniatáu gweithrediadau gweinyddol mewn cyrsiau a’r adran Defnyddwyr - gweld rhestr fod wedi cael eu galluogi hefyd. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"I olygu adran defnyddiwr, rhaid i’r adran Defnyddwyr - caniatáu gweithrediadau gweinyddol mewn cyrsiau a’r adran Defnyddwyr - gweld rhestr fod wedi cael eu galluogi hefyd.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Pan fydd wedi cael ei analluogi, bydd myfyrwyr yn dal i allu anfon negeseuon unigol at athrawon cyrsiau, cynorthwywyr dysgu cyrsiau, a myfyrwyr sy’n rhan o’r un grwpiau ar lefel y cyfrif.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Pan fydd wedi cael ei analluogi, bydd myfyrwyr yn dal i allu anfon negeseuon unigol at athrawon cyrsiau, cynorthwywyr dysgu cyrsiau, a myfyrwyr sy’n rhan o’r un grwpiau ar lefel y cyfrif.\"},\"da\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Gør det muligt for en bruger at sende beskeder til enkelte af fagets deltagere.\",\"conversations_69a8dc26\":\"Samtale\",\"people_b4ebb13c\":\"Deltagere\",\"people_course_ddd9a66\":\"Deltagere (fag)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"For at redigere en brugers sektion skal Brugere - tillad administrative handlinger i fag og Brugere - vis liste også være aktiveret. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"For at redigere en brugers sektion skal Brugere - tillad administrative handlinger i fag og Brugere - vis liste også være aktiveret.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Når deaktiveret, kan studerende stadig sende individuelle beskeder til fagets lærere, undervisningsassistenter og studerende, der hører til de samme grupper på kontoniveau.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Når de er deaktiveret, kan studerende stadig sende enkelte beskeder til fagets lærere, undervisningsassistenter og studerende, der hører til de samme grupper på kontoniveau.\"},\"da-x-k12\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Gør det muligt for en bruger at sende beskeder til enkelte af fagets deltagere.\",\"conversations_69a8dc26\":\"Samtale\",\"people_b4ebb13c\":\"Deltagere\",\"people_course_ddd9a66\":\"Deltagere (fag)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"For at redigere en brugers sektion skal Brugere - tillad administrative handlinger i fag og Brugere - vis liste også være aktiveret. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"For at redigere en brugers sektion skal Brugere - tillad administrative handlinger i fag og Brugere - vis liste også være aktiveret.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Når deaktiveret, kan elever stadig sende individuelle beskeder til fagets lærere, undervisningsassistenter og elever, der hører til de samme grupper på kontoniveau.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Når de er deaktiveret, kan elever stadig sende enkelte beskeder til fagets lærere, undervisningsassistenter og elever, der hører til de samme grupper på kontoniveau.\"},\"de\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Erlaubt dem Benutzer, eine Nachricht an einzelne Kursteilnehmer zu senden.\",\"conversations_69a8dc26\":\"Conversations\",\"people_b4ebb13c\":\"Personen\",\"people_course_ddd9a66\":\"Menschen (Kurs)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Um den Abschnitt eines Benutzers zu bearbeiten, müssen die Berechtigungen „Benutzer – administrative Aktionen in Kursen erlauben“ und „Benutzer – Liste anzeigen“ ebenfalls aktiviert sein. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Um den Abschnitt eines Benutzers zu bearbeiten, müssen die Berechtigungen „Benutzer – administrative Aktionen in Kursen erlauben“ und „Benutzer – Liste anzeigen“ ebenfalls aktiviert sein.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Wenn diese Option deaktiviert ist, können die Studenten immer noch einzelne Nachrichten an Lehrer, Kurs-TAs und Studenten senden, die zu Gruppen derselben Kontoebene gehören.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Wenn diese Option deaktiviert ist, können die Studenten immer noch einzelne Nachrichten an Lehrer, Kurs-TAs und Studenten senden, die zu Gruppen der gleichen Kontoebene gehören.\"},\"el\":{\"conversations_69a8dc26\":\"Συνομιλίες\",\"people_b4ebb13c\":\"Κοινό\"},\"en-AU\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Allows user to send messages to individual course members.\",\"conversations_69a8dc26\":\"Conversations\",\"people_b4ebb13c\":\"People\",\"people_course_ddd9a66\":\"People (Course)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"To edit a user’s section, Users - allow administrative actions in courses and Users - view list must also be enabled. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"To edit a user’s section, Users - allow administrative actions in courses and Users - view list must also be enabled.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"When disabled, students can still send individual messages to course teachers, course TAs, and students who belong to the same account-level groups.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"When disabled, students can still send individual messages to course teachers, course TAs, and students that belong to the same account-level groups.\"},\"en-CA\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Allows user to send messages to individual course members.\",\"conversations_69a8dc26\":\"Conversations\",\"people_b4ebb13c\":\"People\",\"people_course_ddd9a66\":\"People (Course)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"To edit a user’s section, Users - allow administrative actions in courses and Users - view list must also be enabled. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"To edit a user’s section, Users - allow administrative actions in courses and Users - view list must also be enabled.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"When disabled, students can still send individual messages to course teachers, course TAs, and students who belong to the same account-level groups.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"When disabled, students can still send individual messages to course teachers, course TAs, and students that belong to the same account-level groups.\"},\"en-GB\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Allows user to send messages to individual course members.\",\"conversations_69a8dc26\":\"Conversations\",\"people_b4ebb13c\":\"People\",\"people_course_ddd9a66\":\"People (course)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"To edit a user’s section, Users - allow administrative actions in courses and Users - view list must also be enabled. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"To edit a user’s section, Users - allow administrative actions in courses and Users - view list must also be enabled.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"When disabled, students can still send individual messages to course teachers, course TAs, and students who belong to the same account-level groups.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"When disabled, students can still send individual messages to course teachers, course TAs, and students that belong to the same account-level groups.\"},\"es\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Permite al usuario enviar mensajes a miembros individuales del curso.\",\"conversations_69a8dc26\":\"Mensajería\",\"people_b4ebb13c\":\"Personas\",\"people_course_ddd9a66\":\"Personas (Curso)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Para editar la sección de un usuario, también se debe habilitar Usuarios: permitir acciones administrativas en cursos (Users - allow administrative actions in courses) y Usuarios - ver lista (Users - view list). \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Para editar la sección de un usuario, también se debe habilitar Usuarios: permitir acciones administrativas en cursos (Users - allow administrative actions in courses) y Usuarios - ver lista (Users - view list).\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Cuando se deshabilita, los estudiantes pueden enviar mensajes individuales a los profesores del curso, profesores asistentes del curso y estudiantes que pertenezcan a grupos al mismo nivel de cuenta.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Cuando esté desactivado, los estudiantes aún pueden enviar mensajes individuales a los profesores del curso, profesores auxiliares del curso y estudiantes que pertenezcan a grupos del mismo nivel de cuenta.\"},\"fa\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"به کاربر اجازه می دهد تا برای اعضای درس انفردی پیام ارسال کند.\",\"conversations_69a8dc26\":\"گفتگوها\",\"people_b4ebb13c\":\"افراد\",\"people_course_ddd9a66\":\"افراد (درس)\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"در صورت غیرفعال شدن، دانشجویان همچنان می‌توانند پیام های فردی را برای اساتید درس، دستیاران آموزشی درس و دانشجویان که در همان گروه‌های سطح حساب هستند، ارسال کنند.\"},\"fi\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Sallii käyttäjän lähettää viestejä yksittäisille kurssin jäsenille\",\"conversations_69a8dc26\":\"Keskustelut\",\"people_b4ebb13c\":\"Henkilöt\",\"people_course_ddd9a66\":\"Henkilöt (Kurssi)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Jos haluat muokata käyttäjän osiota, Käyttäjät - salli hallinnollisia toimintoja kursseilla ja Käyttäjät - tarkastele luetteloa -valintojen täytyy myös olla käytössä. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Jos haluat muokata käyttäjän osiota, Käyttäjät - salli hallinnollisia toimintoja kursseilla ja Käyttäjät - tarkastele luetteloa -valintojen täytyy myös olla käytössä.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Kun pois käytöstä, opiskelijat voivat yhä lähettää yksilöllisiä viestejä kurssin opettajille, kurssin apuopettajille, ja opiskelijoille, jotka kuuluvat samoihin ryhmiin tilitasolla.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Kun pois käytöstä, opiskelijat voivat yhä lähettää yksilöllisiä viestejä kurssin opettajille, kurssin apuopettajille, ja opiskelijoille, jotka kuuluvat samoihin ryhmiin tilitasolla.\"},\"fr\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Permet à l'utilisateur d'envoyer des messages aux différents membres du cours.\",\"conversations_69a8dc26\":\"Conversations\",\"people_b4ebb13c\":\"Personnes\",\"people_course_ddd9a66\":\"Personnes (Cours)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Pour modifier la section d'un utilisateur, les autorisations Utilisateurs - Autoriser les actions administratives dans les cours et Utilisateurs - Afficher la liste doivent également être activées.\",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Pour modifier la section d'un utilisateur, les autorisations Utilisateurs - Autoriser les actions administratives dans les cours et Utilisateurs - Afficher la liste doivent également être activées.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Lorsqu'ils sont désactivés, les élèves peuvent toujours envoyer des messages individuels aux professeurs de cours, aux AE de cours et aux élèves qui appartiennent aux mêmes groupes au niveau du compte.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Lorsqu'ils sont désactivés, les élèves peuvent toujours envoyer des messages individuels aux professeurs de cours, aux AE de cours et aux élèves qui appartiennent aux mêmes groupes au niveau du compte.\"},\"fr-CA\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Permet à l'utilisateur d'envoyer un message aux membres individuels du cours.\",\"conversations_69a8dc26\":\"Conversations\",\"people_b4ebb13c\":\"Personnes\",\"people_course_ddd9a66\":\"Personnes (cours)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Pour modifier une section de l'utilisateur, « Utilisateurs - autoriser les actions administratives dans les cours » et « Utilisateurs - voir la liste » doivent également être activés.\",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Pour modifier une section de l'utilisateur, « Utilisateurs - autoriser les actions administratives dans les cours » et « Utilisateurs - voir la liste » doivent également être activés.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Lorsque cette option est désactivée, les étudiants peuvent toujours envoyer des messages individuels aux enseignants, aux AE de cours et les étudiants qui appartiennent aux mêmes groupes de niveau du compte.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Lorsque cette option est désactivée, les étudiants peuvent toujours envoyer des messages individuels aux enseignants, aux AE de cours et les étudiants qui appartiennent aux mêmes groupes de niveau du compte.\"},\"he\":{\"conversations_69a8dc26\":\"שיחות\",\"people_b4ebb13c\":\"אנשים\"},\"ht\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Pèmèt itilizatè a voye yon mesaj bay chak moun nan kou a.\",\"conversations_69a8dc26\":\"Konvèsasyon\",\"people_b4ebb13c\":\"Moun\",\"people_course_ddd9a66\":\"Kontak (Kou)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Pou chanje seksyon yon itilizatè, yo dwe aktive fonksyon Itilizatè - otorize aksyon administratif epi Itilizatè - afiche lis. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Pou chanje seksyon yon itilizatè, yo dwe aktive fonksyon Itilizatè - otorize aksyon administratif epi Itilizatè - afiche lis.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Lè l dezaktive, elèv yo ka toujou voye mesaj endividyèl bay pwofesè kou yo, AP kou yo epi bay elèv ki nan menm gwoup nan nivo kont yo.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Lè li dezaktive, elèv yo ka toujou voye mesaj pèsonèl bay pwofesè ak AP kou yo, epi bay elèv ki nan menm gwoup onivo kont lan.\"},\"hu\":{\"conversations_69a8dc26\":\"Üzenetváltások\",\"people_b4ebb13c\":\"Résztvevők\"},\"hy\":{\"conversations_69a8dc26\":\"Խոսակցություններ\",\"people_b4ebb13c\":\"Մարդիկ\"},\"is\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Gerir notanda kleift að senda skilaboð einstakra meðlima námskeiðs.\",\"conversations_69a8dc26\":\"Samræður\",\"people_b4ebb13c\":\"Fólk\",\"people_course_ddd9a66\":\"Fólk (námskeið)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Til að breyta hluta notanda verður einnig að virkja Notendur - leyfa stjórnendaaðgerðir á námskeiðum, og Notendur - yfirlitslisti. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Til að breyta hluta notanda verður einnig að virkja Notendur - leyfa stjórnendaaðgerðir á námskeiðum, og Notendur - yfirlitslisti.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Þegar slökkt er á þessu geta nemendur enn sent einstök skilaboð til kennara námskeiðs, aðstoðarkennara námskeiðs og nemenda sem tilheyra sömu reikningsstigshópum.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Þegar þetta er óvirkt geta nemendur samt sent einstök skilaboð til kennara námskeiðs, aðstoðarkennara námskeiðs, og nemenda sem tilheyra sömu hópum á reikningsstigi.\"},\"it\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Consente all'utente di inviare messaggi a singoli membri del corso.\",\"conversations_69a8dc26\":\"Conversazioni\",\"people_b4ebb13c\":\"Persone\",\"people_course_ddd9a66\":\"Persone (corso)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Per modificare la sezione di un utente, devono essere abilitati anche Utenti - permetti azioni amministrative in corsi e Utenti - visualizza elenco. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Per modificare la sezione di un utente, devono essere abilitati anche Utenti - permetti azioni amministrative in corsi e Utenti - visualizza elenco.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Quando è disattivato, gli studenti possono comunque inviare messaggi individuali ai docenti del corso, agli assistenti dei docenti del corso e agli studenti che appartengono agli stessi gruppi a livello di account.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Se l'opzione è disattivata, gli utenti possono comunque inviare singoli messaggi a insegnanti del corso, assistenti del corso e studenti che appartengono agli stessi gruppi a livello di account.\"},\"ja\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"ユーザーが個々のコースメンバーにメッセージを送信できるようにします。\",\"conversations_69a8dc26\":\"会話\",\"people_b4ebb13c\":\"メンバー\",\"people_course_ddd9a66\":\"人物（コース）\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"受講生のセクションを編集するには、ユーザー - コースでの管理アクションを許可し、ユーザー-リストの表示も有効にされていなければなりません。 \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"受講生のセクションを編集するには、ユーザー - コースでの管理アクションを許可し、ユーザー-リストの表示も有効にされていなければなりません。\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"無効にしても、受講生はコース講師、コースTA、同じアカウントレベルのグループに所属する受講生に個別のメッセージを送信できます。\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"無効にしても、受講生はコース講師、コースTA、同じアカウントレベルのグループに所属する受講生に個別のメッセージを送信できます。\"},\"ko\":{\"conversations_69a8dc26\":\"대화\",\"people_b4ebb13c\":\"사용자\"},\"mi\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Ka whakāetia te kaiwhakamahi ki te tuku karere ki ngā mema akoranga takitahi.\",\"conversations_69a8dc26\":\"Kōrerorero\",\"people_b4ebb13c\":\"Tāngata\",\"people_course_ddd9a66\":\"Tāngata (Akoranga)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Hei whakatika i te wāhanga o ngā ākonga, Ngā Kaiwhakamahi -tukua whakahaere mahi i roto i ngā akoranga me ngā Kaiwhakamahi - me whakahohe hoki te rārangi tirohanga. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Hei whakatika i te wāhanga o ngā ākonga, Ngā Kaiwhakamahi -tukua whakahaere mahi i roto i ngā akoranga me ngā Kaiwhakamahi - me whakahohe hoki te rārangi tirohanga.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Ina monokia, ka taea tonu e ngā ākonga te tuku ngā karere ki ngā kaiako akoranga, ngā TAs akoranga, me ngā ākonga e hono ana ki ngā pūkete - taumata röpü.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Ina monokia, ka taea tonu e ngā ākonga te tuku ngā karere ki ngā kaiako akoranga, ngā TAs akoranga, me ngā ākonga e hono ana ki ngā pūkete - taumata röpü.\"},\"nb\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Lar en bruker sende en melding til individuelle emnedeltakere.\",\"conversations_69a8dc26\":\"Samtaler\",\"people_b4ebb13c\":\"Personer\",\"people_course_ddd9a66\":\"Folk (emne)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"For å redigere en lærers seksjon, må 'Brukere - tillat administrative handlinger i emner og Brukere - vis liste også være aktivert.\",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"For å redigere en lærers seksjon, må 'Brukere - tillat administrative handlinger i emner og Brukere - vis liste også være aktivert.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Hvis deaktivert vil studenter fortsatt kunne sende individuelle meldinger til emnelærere, emne-LA-er og studenter som tilhører samme grupper på kontonivå.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Hvis deaktivert vil studenter fortsatt kunne sende individuelle meldinger til emnelærere, emne-LA-er og studenter som tilhører samme grupper på kontonivå.\"},\"nb-x-k12\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Lar en bruker sende en melding til individuelle fagdeltakere.\",\"conversations_69a8dc26\":\"Samtaler\",\"people_b4ebb13c\":\"Deltakere\",\"people_course_ddd9a66\":\"Deltaker (fag)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"For å redigere en lærers seksjon, må 'Brukere - tillat administrative handlinger i fag og Brukere - vis liste også være aktivert.\",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"For å redigere en lærers seksjon, må 'Brukere - tillat administrative handlinger i fag og Brukere - vis liste også være aktivert.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Hvis deaktivert vil elever fortsatt kunne sende individuelle meldinger til faglærere, fag-LA-er og elever som tilhører samme grupper på kontonivå.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Hvis deaktivert vil elever fortsatt kunne sende individuelle meldinger til faglærere, fag-LA-er og elever som tilhører samme grupper på kontonivå.\"},\"nl\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Hiermee kan een gebruiker berichten verzenden naar individuele cursisten.\",\"conversations_69a8dc26\":\"Gesprekken\",\"people_b4ebb13c\":\"Personen\",\"people_course_ddd9a66\":\"Personen (cursus)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Om een sectie van een gebruiker te bewerken, moeten Gebruikers - administratieve acties in cursussen toestaan en Gebruikers - lijst weergeven ook zijn ingeschakeld. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Om een sectie van een gebruiker te bewerken, moeten Gebruikers - administratieve acties in cursussen toestaan en Gebruikers - lijst weergeven ook zijn ingeschakeld.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Indien uitgeschakeld kunnen cursisten nog steeds afzonderlijke berichten naar cursusdocenten, onderwijsassistenten en cursisten sturen die deel uitmaken van dezelfde groepen op accountniveau.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Wanneer deze optie is uitgeschakeld, kunnen cursisten nog steeds afzonderlijke berichten naar cursusleiders, onderwijsassistenten en cursisen sturen die deel uitmaken van dezelfde groepen op accountniveau.\"},\"nn\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Gir brukar løyve til å sende meldingar til individuelle emnemedlem.\",\"conversations_69a8dc26\":\"Samtalar\",\"people_b4ebb13c\":\"Personar\",\"people_course_ddd9a66\":\"Personar (Emne)\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Sjølv om den er slått av, kan studentar framleis sende individuelle meldingar til faglærarar på emna, undervisingsassistentar og andre studentar som tilhøyrer grupper på same kontonivå.\"},\"pl\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Pozwala użytkownikowi na wysyłanie wiadomości do poszczególnych uczestników kursu.\",\"conversations_69a8dc26\":\"Rozmowy\",\"people_b4ebb13c\":\"Osoby\",\"people_course_ddd9a66\":\"Ludzie (kurs)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Aby edytować sekcję użytkownika, należy także włączyć opcje Użytkownicy - Zezwalaj na działania administracyjne w kursach i Użytkownicy - Wyświetl listę. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Aby edytować sekcję użytkownika, należy także włączyć opcje Użytkownicy - Zezwalaj na działania administracyjne w kursach i Użytkownicy - Wyświetl listę.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"W przypadku włączenia, uczestnicy nadal mogą wysyłać osobne wiadomości do nauczycieli, asystentów instruktorów i uczestników, którzy należą do tych samych grup na poziomie konta.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"W przypadku włączenia, uczestnicy nadal mogą wysyłać osobne wiadomości do nauczycieli, asystentów instruktorów i uczestników, którzy należą do tych samych grup na poziomie konta.\"},\"pt\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Permite ao utilizador enviar mensagens para membros individuais da disciplina.\",\"conversations_69a8dc26\":\"Conversas\",\"people_b4ebb13c\":\"Pessoas\",\"people_course_ddd9a66\":\"Pessoas (disciplina)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Para editar a seção de um utilizador, os Utilizadores - permitir ações administrativas nas disciplinas e os Utilizadores - ver lista de visualização devem também ser ativados. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Para editar a seção de um utilizador, os Utilizadores - permitir ações administrativas nas disciplinas e os Utilizadores - a lista de visualização deve também ser ativada.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Quando incapacitados, os alunos ainda podem enviar mensagens individuais aos professores da disciplina, aos TAs da disciplina e aos alunos que pertencem aos mesmos grupos de nível de conta.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Quando desativado, os alunos ainda podem enviar mensagens individuais para os professores da disciplina, os TAs da disciplina e os alunos que pertencem aos mesmos grupos no nível da conta.\"},\"pt-BR\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Permite que o usuário envie mensagens para membros individuais do curso.\",\"conversations_69a8dc26\":\"Caixa de Entrada\",\"people_b4ebb13c\":\"Pessoas\",\"people_course_ddd9a66\":\"Pessoas (Curso)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Para editar a seção de um usuário, Usuários - permitir ações administrativas em cursos e Usuários - visualizar lista também devem estar ativados. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Para editar a seção de um usuário, Usuários - permitir ações administrativas em cursos e Usuários - visualizar lista também devem estar ativados.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Quando desativado, os alunos ainda podem enviar mensagens individuais para professores do curso, TAs do curso e alunos que pertencem aos mesmos grupos de nível de conta.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Quando desabilitada, alunos ainda podem enviar mensagens individuais a professores do curso, assistente do curso e alunos que pertencem aos mesmos grupos de nível da conta.\"},\"ru\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Позволяет пользователю отправлять сообщения отдельным участникам курса.\",\"conversations_69a8dc26\":\"Обсуждения\",\"people_b4ebb13c\":\"Пользователи\",\"people_course_ddd9a66\":\"Люди (курс)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Чтобы отредактировать раздел учащегося также следует включить параметры «Пользователи - разрешить административные действия с курсами» и «Пользователи - просмотреть список». \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Чтобы отредактировать раздел учащегося также следует включить параметры «Пользователи - разрешить административные действия с курсами» и «Пользователи - просмотреть список».\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Если эта опция отключена, учащиеся все равно могут отправлять отдельные сообщения преподавателям курсов, ассистентам преподавателей и учащимся, которые входят в группы с тем же уровнем учетной записи.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Если отключено, студенты все равно могут отправлять отдельные сообщения преподавателям курсов, ассистентам преподавателей курсов и студентам, которые входят в те же группы уровня учетной записи.\"},\"sl\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Dovoljuje uporabniku, da pošilja sporočila posameznim osebam pri predmetu.\",\"conversations_69a8dc26\":\"Pogovori\",\"people_b4ebb13c\":\"Sodelujoči\",\"people_course_ddd9a66\":\"Sodelujoči (Predmet)\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Če je onemogočeno, lahko študenti vseeno pošiljajo posamezna sporočila izvajalcem predmetov, demonstratorjem pri predmetih in študentom, ki pripadajo istim skupinam na ravni računa.\"},\"sv\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Gör det möjligt för användaren att skicka ett meddelande till enskilda kursdeltagare.\",\"conversations_69a8dc26\":\"Konversationer\",\"people_b4ebb13c\":\"Personer\",\"people_course_ddd9a66\":\"Personer (kurs)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Om du vill redigera en användares sektion måste Användare – tillåt administrativa åtgärder i kurser och Användare – visa lista vara aktiverade. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Om du vill redigera en användares sektion måste Användare – tillåt administrativa åtgärder i kurser och Användare – visa lista vara aktiverade.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Om inaktiverad, kan studenter ändå skicka individuella meddelanden till kursen lärare, lärarassistenter och studenter som hör hemma i samma kontonivågrupper.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Även om den här inställningen är inaktiverad kan studenter ändå skicka enskilda meddelanden till kursens lärare, lärarassistenter och studenter som tillhör grupper på samma kontonivå.\"},\"sv-x-k12\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"Gör det möjligt för användaren att skicka ett meddelande till enskilda kursdeltagare.\",\"conversations_69a8dc26\":\"Konversationer\",\"people_b4ebb13c\":\"Personer\",\"people_course_ddd9a66\":\"Personer (kurs)\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"Om du vill redigera en användares sektion måste Användare – tillåt administrativa åtgärder i kurser och Användare – visa lista vara aktiverade. \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"Om du vill redigera en användares sektion måste Användare – tillåt administrativa åtgärder i kurser och Användare – visa lista vara aktiverade.\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"Om inaktiverad, kan elever ändå skicka individuella meddelanden till kursen lärare, lärarassistenter och elever som hör hemma i samma kontonivågrupper.\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"Även om den här inställningen är inaktiverad kan elever ändå skicka enskilda meddelanden till kursens lärare, lärarassistenter och elever som tillhör grupper på samma kontonivå.\"},\"tr\":{\"conversations_69a8dc26\":\"Mesajlaşmalar\",\"people_b4ebb13c\":\"Kişi\"},\"uk\":{\"conversations_69a8dc26\":\"Бесіди\",\"people_b4ebb13c\":\"Люди\"},\"zh-Hans\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"允许用户向个别课程成员发送消息。\",\"conversations_69a8dc26\":\"会话\",\"people_b4ebb13c\":\"人员\",\"people_course_ddd9a66\":\"人员（课程）\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"如需编辑用户班次，还必须启用“用户 - 允许在课程中进行管理操作”和“用户 - 查看列表”。 \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"如需编辑用户班次，还必须启用“用户 - 允许在课程中进行管理操作”和“用户 - 查看列表”。\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"如果禁用，学生仍然可以向课程教师、课程助教以及属于同一帐户级小组的学生单独发送消息。\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"禁用后，学生仍然可以向课程教师、课程助教和属于同一帐户级别组的学生发送个人信息。\"},\"zh-Hant\":{\"allows_user_to_send_messages_to_individual_course__9347e1e2\":\"允許使用者傳送訊息至個別學生。\",\"conversations_69a8dc26\":\"交談\",\"people_b4ebb13c\":\"人員\",\"people_course_ddd9a66\":\"成員（課程）\",\"to_edit_a_user_s_section_users_allow_administrativ_69b3cdaa\":\"要編輯一名使用者的分班，必須同時啟用「使用者 - 允許在課程內進行管理行動」及「使用者 - 檢視清單」。 \",\"to_edit_a_user_s_section_users_allow_administrativ_966b3fcc\":\"要編輯一名使用者的分班，必須同時啟用「使用者 - 允許在課程內進行管理行動」及「使用者 - 檢視清單」。\",\"when_disabled_students_can_still_send_individual_m_3bf396f2\":\"停用後，學生仍能向屬於同一帳戶級別小組的課程教師、課程助教及學生發送個別訊息。\",\"when_disabled_students_can_still_send_individual_m_567a911c\":\"停用後，學生仍能向屬於同一帳戶級別小組的課程教師、課程助教及學生發送個別訊息。\"}}"));
